alter TABLE tmp_viitenr add COLUMN viitenr text;

DROP FUNCTION IF EXISTS lapsed.generate_vn();

CREATE FUNCTION lapsed.generate_vn()
    RETURNS INTEGER
    LANGUAGE plpgsql
AS
$$
DECLARE
    v_vn      RECORD;
    l_count   INTEGER = 0;
    l_vn      TEXT;
BEGIN

    FOR v_vn IN
        SELECT * FROM tmp_viitenr where not empty(vn)
        LOOP
            l_vn = lapsed.get_control_number(v_vn.vn);
             UPDATE  tmp_viitenr set viitenr = l_vn  where vn = v_vn.vn;
        END LOOP;
    RETURN l_count;

END;
$$;

SELECT lapsed.generate_vn();

DROP FUNCTION IF EXISTS lapsed.generate_vn();
